import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import { Link } from 'react-router-dom';

import '../styles/thank-you.css'

const ThankYou = () => {
  return <section>
    <Container>
        <Row>
            <Col lg='12'>
                <span> <i class="ri-checkbox-circle-line"></i> </span>
            </Col>
        </Row>
    </Container>
  </section>
}

export default ThankYou
